import React from "react"
import products from "./Data"

function List(){
    const productArrayListItem = products.map(
        product => <ListItem key={product.id} name={product.name} price={product.price} />
    )

    return (
        <div>
            {productArrayListItem}
        </div>
    )
}

export default List
